{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/desalegngeb/a-short-tutorial-in-r-easy-start?scriptVersionId=107738432\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"3bda1d3b","metadata":{"papermill":{"duration":0.087181,"end_time":"2022-10-11T11:03:46.577158","exception":false,"start_time":"2022-10-11T11:03:46.489977","status":"completed"},"tags":[]},"source":["## A short tutorial in R\n","\n","![](https://www.r-project.org/Rlogo.png)\n","\n","*Image source*: [www.r-project.org](https://www.r-project.org/) \n","\n","<hr/>\n","\n","#### Objective:\n","Learn the basics of R by examples.\n","#### Note: \n","This is a notebook which I *compiled* while learning R for the first time. It is a brief and basic introduction to R programming language which absolute beginners could find helpful.\n","If you notice any error or would like to suggest improvement points, please let me know. \n","\n","\n","<hr/>\n","<a id=\"top\"></a>\n","\n","## Table of Contents\n","\n","- [1. Introduction](#1)\n","- [2. Getting help](#2)\n","- [3. Variables and Assignments](#3)\n","- [4. Data Structure](#4)\n","- [5. Extracting Parts of Data Structures](#5)\n","- [6. Importing Data](#6)\n","- [7. Control Structures](#7)\n","- [8. Functions](#8)\n","- [9. Plotting  with base R](#9)\n","- [10. Working with Data Frames using **`dplyr`**](#10)\n","- [11. Plotting with **`ggplot2`**](#11)\n","- [12. Customizing **`ggplot2`** plots](#12)\n","- [13. Correlation heatmap](#13)\n","- [14. Bibliography](#14)\n","\n","---\n"]},{"cell_type":"markdown","id":"491a6d5c","metadata":{"papermill":{"duration":0.082748,"end_time":"2022-10-11T11:03:46.741454","exception":false,"start_time":"2022-10-11T11:03:46.658706","status":"completed"},"tags":[]},"source":["<a id=\"1\"></a>\n","## 1. Introduction\n","\n","### What is R?\n","\n","* R is a free statistical software and it is also a programming language.\n","* It is an open source implementation of the [S programing langauge](https://bookdown.org/rdpeng/rprogdatascience/history-and-overview-of-r.html#what-is-r).\n","* It is highly extendable; that is to say users can write functions and easily add software libraries to R.\n","* It is interactive; you type what you want and get out the corresponding results.\n","\n","<a id=\"2\"></a>\n","## 2. Getting help\n","\n","There are many ways one can get help for R.\n","* On the Internet, for example at www.r-project.org\n","* From the command line if you know the command/topic you want help for\n","    - help(command)\n","        - example: help(log)\n","    - ?command\n","        - example: ?log\n","    - ??topic\n","        - example: ??logarithm"]},{"cell_type":"code","execution_count":1,"id":"d39a0791","metadata":{"execution":{"iopub.execute_input":"2022-10-11T11:03:46.91758Z","iopub.status.busy":"2022-10-11T11:03:46.914944Z","iopub.status.idle":"2022-10-11T11:03:47.03021Z","shell.execute_reply":"2022-10-11T11:03:47.028763Z"},"papermill":{"duration":0.204338,"end_time":"2022-10-11T11:03:47.030396","exception":false,"start_time":"2022-10-11T11:03:46.826058","status":"completed"},"tags":[]},"outputs":[],"source":["# help(lm)\n","# ?tanh\n","# ??regression"]},{"cell_type":"markdown","id":"3ac18e7b","metadata":{"papermill":{"duration":0.08339,"end_time":"2022-10-11T11:03:47.197931","exception":false,"start_time":"2022-10-11T11:03:47.114541","status":"completed"},"tags":[]},"source":["<a id=\"3\"></a>\n","## 3. Variables and Assignments\n","* The assignment operator in R is `<-` .\n","* Use `parenthesis ()` to assign a variable and print it."]},{"cell_type":"code","execution_count":2,"id":"ba117a86","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-10-11T11:03:47.403341Z","iopub.status.busy":"2022-10-11T11:03:47.370443Z","iopub.status.idle":"2022-10-11T