.26391","exception":false,"start_time":"2022-10-11T11:04:03.14529","status":"completed"},"tags":[]},"source":[" <a href=\"#top\">Back to top</a>\n","\n","<a id=\"8\"></a>\n","## 8. Functions\n","* A function is essentially a sequence of commands executed based on certain arguments passed to the function.\n","\n","* In R a function is defined using the general format:\n","\n",">    myfunction <- **function**(arg1, arg2, ...)    \n",">    {     \n",">    code to excecute\n",">\n",">    }\n","\n","    \n","* The name of the function is \"myfunction\" and to use this function one needs to pass three arguments\n","* A function may or may not return something back that you can store for later use\n","* To use a function, you simply call the function with its arguments \n","    \n","   \n",">    **myfuntion**(arg1, arg1, ...) \n","    \n","\n","\n","#### Example: \n","Let's write a function which takes two integers and returns the square-root of the sum of thier squares. \n","    \n","f(x, y) = $\\sqrt{{x}^2 +{y}^2 }$\n","   \n","\n","    "]},{"cell_type":"code","execution_count":45,"id":"ce040d73","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-10-11T11:04:03.515373Z","iopub.status.busy":"2022-10-11T11:04:03.513429Z","iopub.status.idle":"2022-10-11T11:04:03.532169Z","shell.execute_reply":"2022-10-11T11:04:03.530526Z"},"papermill":{"duration":0.146014,"end_time":"2022-10-11T11:04:03.532314","exception":false,"start_time":"2022-10-11T11:04:03.3863","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["5"],"text/latex":["5"],"text/markdown":["5"],"text/plain":["[1] 5"]},"metadata":{},"output_type":"display_data"}],"source":["pyth <- function(x, y)\n","    {\n","    return(sqrt((x)^2 +(y)^2))\n","}\n","\n","pyth(3, 4)"]},{"cell_type":"markdown","id":"6eee4263","metadata":{"_kg_hide-output":true,"papermill":{"duration":0.122795,"end_time":"2022-10-11T11:04:03.777929","exception":false,"start_time":"2022-10-11T11:04:03.655134","status":"completed"},"tags":[]},"source":["#### Example:\n","Let's write a function to calculate a standard deviation of a vector x\n","\n","sd = $\\sqrt{\\frac{1}{n-1}\\sum\\limits_{i=1}^{n}(x_i - \\bar{x})^2} $"]},{"cell_type":"code","execution_count":46,"id":"b2d7eda5","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-10-11T11:04:04.028419Z","iopub.status.busy":"2022-10-11T11:04:04.026481Z","iopub.status.idle":"2022-10-11T11:04:04.051371Z","shell.execute_reply":"2022-10-11T11:04:04.049899Z"},"papermill":{"duration":0.150078,"end_time":"2022-10-11T11:04:04.051503","exception":false,"start_time":"2022-10-11T11:04:03.901425","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["0.796389404394042"],"text/latex":["0.796389404394042"],"text/markdown":["0.796389404394042"],"text/plain":["[1] 0.7963894"]},"metadata":{},"output_type":"display_data"}],"source":["stdev <- function(x)\n","    {\n","    s <- sqrt(sum((x - mean(x))^2)/(length(x)-1))\n","    s\n","}\n","\n","z <- rnorm(20)\n","stdev(z)"]},{"cell_type":"markdown","id":"2b70b257","metadata":{"_kg_hide-output":true,"papermill":{"duration":0.119758,"end_time":"2022-10-11T11:04:04.294448","exception":false,"start_time":"2022-10-11T11:04:04.17469","status":"completed"},"tags":[]},"source":["#### Example:\n","Let's write a function to calculate the density of a normal random variable given the mean $\\mu$ and standard deviation $\\sigma$ of a vector x\n","\n","f(x) = $\\frac{1}{\\sigma\\sqrt{2\\pi}} e^{-\\frac{1}{2}\\left(\\frac{x - \\mu}{\\sigma}\\right)^2}$"]},{"cell_type":"code","execution_count":47,"id":"f87f38f3","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-10-11T11:04:04.546973Z","iopub.status.busy":"2022-10-11T11:04:04.545044Z","iopub.status.idle":"2022-10-11T11:04:04.564902Z","shell.execute_reply":"2022-10-11T11:04:04.563762Z"},"papermill":{"duration":0.148142,"end_time":"2022-10-11T11:04:04.565035","exception":false,"start_time":"2022-10-11T11:04:04