,"</div>"]},{"cell_type":"markdown","id":"1c3e3a48","metadata":{"papermill":{"duration":0.132241,"end_time":"2022-10-11T11:04:08.824965","exception":false,"start_time":"2022-10-11T11:04:08.692724","status":"completed"},"tags":[]},"source":["In section 4 of this notebook, we have already seen that data frames are one of the main data structures in R. We have covered how to make data frames and how to operate on them as well using base R (without importing any external library). But there is a lot we can do with data frames than that we have seen so far and are often tidous to do them just in base R. The `dplyr` package is designed to mitigate a lot of these problems and to provide a highly optimized set of routines specifically for dealing with data frames.\n","\n","The official `dplyr` website defines it as : \"`dplyr` is a grammar of data manipulation, providing a consistent set of verbs that help you solve the most common data manipulation challenge\". Some of the key “verbs” provided by the `dplyr` package are:\n","\n","* `select()` picks variables based on their names.\n","* `filter()` picks cases based on their values.\n","* `arrange()` reorder the rows\n","* `mutate()` adds new variables that are functions of existing variables\n","* `summarise()` reduces multiple values down to a single summary.\n","* `group_by()` allows you to perform any operation “by group”\n"]},{"cell_type":"code","execution_count":54,"id":"5fcd4f61","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-10-11T11:04:09.102745Z","iopub.status.busy":"2022-10-11T11:04:09.100825Z","iopub.status.idle":"2022-10-11T11:04:09.131483Z","shell.execute_reply":"2022-10-11T11:04:09.129792Z"},"papermill":{"duration":0.169174,"end_time":"2022-10-11T11:04:09.131625","exception":false,"start_time":"2022-10-11T11:04:08.962451","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects a