there are several options. Few examples are geom_curve(), geom_boxplot(), geom_col(), geom_density(), geom_errorbar(), etc...\n","\n","> ***Note***: I strongly encourage you to have a look at this [cheat sheet](https://www.maths.usyd.edu.au/u/UG/SM/STAT3022/r/current/Misc/data-visualization-2.1.pdf) and see the possible options you can have. \n","\n"]},{"cell_type":"code","execution_count":71,"id":"2dde8f40","metadata":{"execution":{"iopub.execute_input":"2022-10-11T11:04:17.756265Z","iopub.status.busy":"2022-10-11T11:04:17.754839Z","iopub.status.idle":"2022-10-11T11:04:18.0683Z","shell.execute_reply":"2022-10-11T11:04:18.067436Z"},"papermill":{"duration":0.45602,"end_time":"2022-10-11T11:04:18.068428","exception":false,"start_time":"2022-10-11T11:04:17.612408","status":"completed"},"tags":[]},"outputs":[],"source":["# import ggplot2 library\n","library(ggplot2)"]},{"cell_type":"markdown","id":"d8d72fe6","metadata":{"papermill":{"duration":0.142158,"end_time":"2022-10-11T11:04:18.34977","exception":false,"start_time":"2022-10-11T11:04:18.207612","status":"completed"},"tags":[]},"source":["#### Let's see the head of the iris data we will be working with for some of the plots"]},{"cell_type":"code","execution_count":72,"id":"85d862c5","metadata":{"execution":{"iopub.execute_input":"2022-10-11T11:04:18.642431Z","iopub.status.busy":"2022-10-11T11:04:18.641109Z","iopub.status.idle":"2022-10-11T11:04:18.666822Z","shell.execute_reply":"2022-10-11T11:04:18.665288Z"},"papermill":{"duration":0.173315,"end_time":"2022-10-11T11:04:18.666976","exception":false,"start_time":"2022-10-11T11:04:18.493661","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 5 × 5</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>Sepal.Length</th><th scope=col>Sepal.Width</th><th scope=col>Petal.Length</th><th scope=col>Petal.Width</th><th scope=col>Species</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=co