nt_text(size = 20),                 # legend title text size\n","              legend.text = element_text(size = 16))                  # legend text size\n","\n","plot\n","                          "]},{"cell_type":"markdown","id":"79eb1950","metadata":{"papermill":{"duration":0.162378,"end_time":"2022-10-11T11:04:28.500595","exception":false,"start_time":"2022-10-11T11:04:28.338217","status":"completed"},"tags":[]},"source":["### 12.2 Plots layout (subplots)\n","* Sometimes we wish to display multiple plots side by side (subplots) to tell our story.  \n","* To make subplotting possible, we need an additional library called `patchwork`\n","* The way `patchworks` works is that:\n","    - first you make your individual plots and then patch them with (+) operator.\n","    - if you wish to set the number of columns (grids) for you plots, you can do so by using the `plot_layout(ncol=n)` function. Othersiwe it will decide by itself the optimal cols and rows for your subplots\n","    - it is also possible to design a custom layout using `plot_layout(design = layout)` function."]},{"cell_type":"code","execution_count":83,"id":"a7017567","metadata":{"execution":{"iopub.execute_input":"2022-10-11T11:04:28.827547Z","iopub.status.busy":"2022-10-11T11:04:28.825965Z","iopub.status.idle":"2022-10-11T11:04:28.877005Z","shell.execute_reply":"2022-10-11T11:04:28.875877Z"},"papermill":{"duration":0.216791,"end_time":"2022-10-11T11:04:28.877144","exception":false,"start_time":"2022-10-11T11:04:28.660353","status":"completed"},"tags":[]},"outputs":[],"source":["# import library\n","library(patchwork)"]},{"cell_type":"code","execution_count":84,"id":"343d4586","metadata":{"execution":{"iopub.execute_input":"2022-10-11T11:04:29.193676Z","iopub.status.busy":"2022-10-11T11:04:29.192363Z","iopub.status.idle":"2022-10-11T11:04:30.318792Z","shell.execute_reply":"2022-10-11T11:04:30.319306Z"},"papermill":{"duration":1.28604,"end_time":"2022-10-11T11:04:30.319502","exception":false,"start_time":